var a = confirm("确定取消订单吗？");
if(a ==true){ 
    var id = ee.getText(ee.getControl("layoutxitem23")); 
    if (id == ""){
        alert("订单编号不能为空");
        return;
    }
    g5.taskIdToDel = id; 
    g5.stuName = ee.getEditText(ee.getControl("edit23"));
    g5.coaName = ee.getEditText(ee.getControl("edit24")); 
    g5.stuMobile = ee.getEditText(ee.getControl("edit4"));
    g5.coaMobile = ee.getEditText(ee.getControl("edit19"));    
    ee.setText(ee.getControl("panel43"),g5.stuName);
    ee.setText(ee.getControl("panel45"),g5.coaName);

    cancel();
}

